INSERT INTO `con_event_blog` VALUES (2,'WTFAQ','FAQ','2016-02-21','<p>Welcome to RollerTron, <a href=\"http://rollercon.com/\" target=\"_blank\">RollerCon\'s</a> newest contribution to making every year the best ever!\r\n<br>RollerTron uses your unique email address as your user name, and allows you to create new teams, challenges, bouts, training and more. The system streamlines the submission and roster process for challenges and games, and gives our RollerCon coaches a chance to submit their training sessions over multiple years with far less hassle. Please check out our frequently asked questions to get started, then check that your personal profile is accurate. <br>\r\nThanks!</p>\r\n\r\n<h3>&nbsp;</h3>\r\n<h3>FAQ</h3>\r\n<ul>\r\n<li><a href=\"#siteneed\">If I\'m going to RollerCon, do I need to use this site?</a></li>\r\n<li><a href=\"#whyemail\">Why do you need my email address? Are you going to spam me?</a></li>\r\n<li><a href=\"#whyskillgender\">Why would I need to change my Skill and Gender? Why does it matter?</a></li>\r\n<li><a href=\"#cantfindme\">My captain can\'t find my name to add me to the team, but I know Im in the system. Whats going on?</a></li>\r\n<li><a href=\"#cantfindthem\">Why can\'t I find the person I\'m looking for to add them to a challenge/training?</a></li>\r\n<li><a href=\"#howcoachemail\">I had the most awesome coach at RollerCon, and I want to invite them to coach my league. How do I do that?</a></li>\r\n<li><a href=\"#howcaptainemail\">I need to email the captain for a challenge I\'m in. How do I do that?</a></li>\r\n<li><a href=\"#nowwhat\">That didn\'t answer my question, so now what?</a></li>\r\n</ul>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"siteneed\"></span>\r\n<p><b>If I\'m going to RollerCon, do I need to use this site?</b></p>\r\n<p>That depends! You <i>need</i> to use this site if you are captaining a challenge or game, or coaching a training session. If you are just <i>attending</i> RollerCon, you do not have to use this site - but you can! Every RollerCon attendee automatically has a site user account linked to the email address they provided when purchasing a RC pass. All users can log in to check the status of every challenge they\'re rostered on, change their skill and gender identification, or just get more information on scheduled training and challenges.</p>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"whyemail\"></span>\r\n<p><b>Why do you need my email address? Are you going to spam me?</b></p>\r\n<p>No, we are not going to spam you. We used your email address as your login because it is unique. Skate names might not be unique, legal names might not be unique and random usernames are unique but frequently forgotten. Your email address is theoretically both unique and memorable for you. There are rare occasions when you might get mail from RollerTron:<ul>\r\n<li>Captains may choose to allow rostered skaters to contact them through RollerTron.</li>\r\n<li>Coaches may choose to allow students to contact them through RollerTron so that they can request a league visit or offer direct feedback. Please do not contact coaches to ask them to sign you up for RollerCon training sessions. They do not have that ability.</li>\r\n<li>There are a small number of alert notifications you might receive from RollerTron. These are rare.</li>\r\n<li>After RollerCon, RollerTron may ask you for feedback regarding training sessions you attended. You may opt out of providing feedback.</li></ul>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"whyskillgender\"></span>\r\n<p><b>Why would I need to change my Skill and Gender? Why does it matter?</b></p>\r\n<p>Captains divide challenges by skill and sometimes by gender. Once a captain sets skill or gender restrictions, the system requires all rostered skaters to meet those requirements. Skaters who do not meet the requirements cannot be added to the roster. Their names will not show up when the captain searches for people to add.</p>\r\n\r\n<p><b>Here\'s how to do it:</b> </br>\r\nSkill and gender can be adjusted in <a href=\"/con/profile/\">My Profile</a>.  International status can only be changed by an RC Admin. Please note that if changing your skill or gender makes you ineligible for a challenge you\'ve already signed up for, RollerTron will warn you. If you confirm, when you no longer meet eligibility requirements set by the captain(s), you will be removed from their roster(s).</p>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"cantfindme\"></span>\r\n<p><b>My captain can\'t find my name to add me to the team, but I know I\'m in the system. What\'s going on?</b></p>\r\n<p>If your skill or gender status makes you ineligible for a roster, your name will not show up in the list of possible skaters to add. Skaters may change their skill and gender in their <a href=\"/con/profile/\" target=\"_blank\">Profile</a> settings. International status may only be changed by a RollerCon admin (on site or via <a href=\"mailto: coordinator@rollercon.com\">email</a>). </p>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"cantfindthem\"></span>\r\n<p><b>Why can\'t I find the person I\'m looking for to add them to my roster or challenge them?</b></p>\r\n<p>The most likely reason for not finding a skater in the potential captain or roster options is that the skater either does not have a RollerCon ticket yet, or does not meet the skill or gender criteria that the captain has set for their team or challenge.</p>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"howcoachemail\"></span>\r\n<p><b>I had the most awesome coach at RollerCon, and I want to invite them to coach my league. How do I do that?</b></p>\r\n<p>Coaches have a choice regarding whether the site can forward email to them or not. Find their Training on the <a href=\"/scheduler/trainings/\">Trainings Home</a> page, go to that training page, and click on their name to find their Coach page. If they allow emails to be sent to them, there will be an email link under their name. If they prefer not to be contacted, there will not be a link. Please do not email coaches asking them to sign you up for their training, or schedule their training on a certain day; they don\'t have the power to do that. They may, however love to hear feedback, or that you would like to have them coach your league.</p>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"howcaptainemail\"></span>\r\n<p><b>I need to email the captain for a challenge I\'m in. How do I do that?</b></p>\r\n<p>Captains have a choice regarding whether the site can forward email to them or not. Go to <a href=\"/scheduler/my_challenges/\">My Challenges & Games</a> and if you\'re on the roster, you\'ll see the challenge there, with a button to email the captain. If they have chosen to be emailed, it will take you to a form to do so. Otherwise, it will let you know that this captain prefers not to be emailed through the site.</p>\r\n<h3>&nbsp;</h3>\r\n\r\n<span class=\"anchor\" id=\"nowwhat\"></span>\r\n<p><b>This didn\'t answer my questions, so now what?</b></p>\r\nPlease try these other resources, listed in order:\r\n<ol><li><a href=\"http://rollercon.com/\" target=\"_blank\">rollercon.com</a></li>\r\n<li><a href=\"https://www.facebook.com/groups/rcchallengeforum/\"  target=\"_blank\">RollerCon Challenges Forum</a></li>\r\n<li><a href=\"mailto:info@rollercon.com\">Pam T. Hamster, Question Answerer</a></li></ol>\r\n\r\nPlease forward database errors and technical issues to the RollerTron System Administrator at <a href=\"rcregsite@gmail.com\">rcregsite@gmail.com</a>.</p>\r\n\r\n\r\n',1);
/*!40000 ALTER TABLE `con_event_blog` ENABLE KEYS */;
UNLOCK TABLES;

