INSERT INTO `scheduler_coach` VALUES (1,'Holly Ween has been skating since 2008 and attending RC since 2009. Since she is an old skater she has started to heavily rely on yoga to save her body, mind, heart and soul as well. It works and because it works so well she became a certified yoga teacher to share this with the rest of the derby world. Holly Ween skates for NAZRD. New WFTDA member as of 2015!',0,6,NULL),(2,'Slinky Ice loves skating and roller derby. She is currently the coaching coordinator and has previously held both Captain and Vice-Captain positions for the Chiko Rollers of Bendigo, Victoria, Australia. Slinky is known for her footwork and toe stop skills which she learned from playing ice hockey and state and national levels. Not only does she dance around the opposition, she also has her own language known as \'Slingo\'!',0,7,NULL),(3,'Gillotine Grace began playing, coaching and captaining roller derby for the Cowboy Capital Rollergirls in 2011. Shes head of training and interim vice chair for the Dallas Derby Devils. She is the current captain of Dallas All Star travel team and Team Texas. Grace is a Deadbolt Pads team rider and a part of Team Blood & Thunder.\r\n',1,8,NULL),(4,'Barbara \"\"Queen B\"\" Dolan created the new market category of Fitness Skating when she founded Derby Lite in 2007.  Since then, she\'s worked with skating and fitness professionals to create progressive Learn-to-Skate, Fitness Skating and Skills & Drills curricula and a partnership program that bring the friends, fun & fitness of roller derby to the average American woman exerciser. We love being friends with benefits with local leagues and helping retirees stay on their skates and share the love of derby.',0,9,NULL),(5,'Fifinailya is a firecracker on and off the track. She has been playing Roller derby for over three years. Co-Founder and Vice Pres of her hometown league, Dark Horse Roller Derby out of Sweetwater, TX. She strives to promote healthy and happy lives in her local/derby community.',0,10,NULL),(6,'Shady Hawkins is a dreamer, a believer, a trainer. Don\'t let her infectious enthusiasm and affinity for playground games fool you, she\'s a tough trainer who holds her skaters to the highest standards. On the LA Derby Dolls Ri-Ettes and Varsity Brawlers, she pushes herself and her teammates to exceed expectations. Shady proudly trains juniors, beginners, freshies, and team level skaters at Los Angeles Derby Dolls.',0,11,NULL),(7,'Booty Quake is the founder and chief motivator at Roller Derby Athletics, providing sport specific training to derby athletes around the world. A lifelong athlete in a variety of sports, Booty has been skating with Terminal City since 2007, and coaching since 2008. Booty has a special interest in off-skate strength and conditioning. She is happiest when sweating, and at after parties! She\'ll kick your ass, so you can go kick someone else\'s... \n\nWhen Lemony Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters. flatmatrollerderby.com',0,12,NULL),(8,'LoudMouth came to roller derby as a fan in 2008, as derby swept across Northern California. After shooting derby photography as a hobby, he decided to teach himself how to skate, and was later invited to help coach and referee at practices. While teaching himself how to skate, and the rules of roller derby, he progressed from assistant coaching to being recruited by a small league to help establish roller derby in Woodland, California. Under this program, and in partnership with other smaller area roller derby leagues, LoudMouth has brought a team of 8 rostered skaters into their first competitive season as Woodland Area Roller Derby.',0,13,NULL),(9,'Pinball has been playing roller derby since 2006 and reffing, coaching and captaining teams since 2010.  She currently skates for Central Coast Roller Derby, Team Rudechix and Team Rex and does travel coaching all over California, specializing in Fresh Meat training. Pinball also does motivational speaking on women empowerment and standing up against violence against women which she shares with the derby community.  She is committed to spreading derby love and knowledge to all and believes that there is a place in derby for everyone. Pinball is dedicated to using derby as a tool to empower women all over world.',0,14,NULL),(10,'Dirty Deborah Harry is a 3rd generation skating instructor, who began her classical training at age four, being coached by both her mother and father.  Her extended family was fortunate enough to own and operate the local roller rink, which meant she literally grew up on wheels.   Dirty possesses a unique ability to teach beginning to advanced skating skills (with a strict focus on technical perfection) and translate those skills into strong derby play.  Her class atmosphere has been described as both humorous and inspirational.   When she is not teaching here or abroad, you can find her playing both banked and flat track derby in Southern California.\n',0,15,NULL),(11,'Don Mynatt, also known as \"The Pantichrist,\" is a Level 4 WFTDA official from the Memphis Rollergirls. He is the WFTDA Officiating Education Director,  responsible for managing the WFTDA education program for referees and non-skating officials. In this position, Don oversees the Officiating Clinics program and works on expanded education and development initiatives, such as testing, online learning, and other resources for Officials.',0,16,NULL),(12,'The Hot Flash skated with Rat City Roller Girls and Tilted Thunder Rail Birds. She later founded OneWorld Roller Derby (Now Seattle Citywide Roller Derby) to bring USARS to the area. She was appointed to the USA Rollersports Roller Derby Discipline Sport Committee for the 2015-2016 Seasons. Flash is currently working with the City of Seattle to implement the first citywide athletic roller derby league debuting April of 2015.',0,17,NULL),(13,'',0,18,NULL),(14,'The 4closer, with the Sacred City Derby Girls, has been on skates since the 80\'s when she competed in artistic figure and freestyle skating in Roseville, CA.  After life changing events in 2006, she realized she missed the wind in her hair and speed of her skates when she became addicted to derby in 2009.  \'4c\' is competing in her 7th season with the SACRED Sacrificers and is the league\'s Jammer Trainer/Coach and Strategy Coach.  With an athletic background in basketball and volleyball she incorporates ball sports skills, movement and strategy in all of her coaching techniques when breaking down drills and use of strategy in derby game play  as well as promoting the belief in the use of \'mind over body\' and the building of muscle memory with the utilization of \'Movement to Music\'.  She strives to keep the mental game of SERIOUS \'not serious\' derby alive and share this outlook with others!\n',0,19,NULL),(15,'Dutch Crunch #76 has been a member of Undead Bettys since June 2010 and during that time she has definitely made her mark both on Undead and in the derby world. Whether she is playing, watching, or coaching roller derby, her love of the game is evident. She was  awarded skater of the year in 2012, Heart of the Undead in 2013, Biggest Double Threat in 2014, and for the last three seasons she was voted team captain. She is always striving to be the best at what she does and pushes her team to also be the best. She\'s athletic and does a tremendous amount of work outside of derby to stay conditioned and on top of her game. She is aggressive, quick and doesn\'t let her small size hinder her. Dutch is continuously studying the rules allowing her to demonstrate amazing strategy knowledge. Whether jamming or blocking, Dutch is known for her leadership and communication on the track.\n',0,20,NULL),(16,'Hurricane Heather has been jam skating since she was a teen. She\'s played roller derby in Pittsburgh for Steel City Roller Derby since 2006, and she\'s proud to be a Riedell SuperStar. Love it, live it, turn left.\n',0,21,NULL),(17,'Hatched among the craggy reaches of her back-woods high-mountain village, Scald Eagle spent the majority of her fledgling years cutting her talons on the frigid ice hockey rinks of Western Colorado. She also did a bajillion squats as a catcher during her extensive softball career, and she\'s done about every athletic or outdoorsy thing a bird can do in the wilds of Colorado. Including, but not limited to, archery hunting, mountain biking, rifle Hhunting, skiing, muzzleloader hunting, rafting, and did I mention hunting? In 2010 she was ready to do the metropolitan thang for a while and so migrated to Portland, Oregon where she immediately discovered the existence of roller derby, the Rose City Rollers, and as it happens, fishing! Due to her athletic background and all the competitive bones in her body, Scald made it onto Fresh Meat and quickly ascended the ranks of RCR. She also found, during this time, that she had developed the knack for snatching up the tasty but elusive Greater Pinkfin Land Tuna. By March of 2011 she was honored to fly for the Wheels of Justice and the Vagine Regime. She has been a proud member of both for three seasons now, and has hated erry minute of it. Ya Welcome! Scald Eagle is sponsored by Sin City Skates, and can be scheduled to coach your league through leftturncoaching.com.',0,22,NULL),(18,'Holly Gohardly has been skating for 9 years and skates on the Charm City Roller Girls All Star team. She is an Atom All Star and sponsored by As the Bearing Turns Skateshop.  She prides herself on her blocking skills, teamwork and knowledge of the game.',0,23,NULL),(19,'Mack the Mouth has been a fixture in Canadian Roller Derby since 2006 when he began announcing for Vancouver\'s Terminal City Roller Girls. In the last five years he has coached at every level; house teams, fresh meat, travel teams, boot-camps, men\'s, juniors, sanctioned bouts and WFTDA Division One playoffs. Mack is a member of the Team Canada coaching staff for World Cup 2011 and 2014. Mack is also a member of the coaching staff for Camp Pivotstar. Mack currently coaches the WFTDA Division One Terminal City Allstars out of Vancouver, BC Canada. Have Mack visit your league! For more info, check out www.camppivotstar.com',0,24,NULL),(20,'Snot Rocket Science is a two time member of Team USA Roller Derby. She is a former competitive figure skater and has played with Pittsburgh, PA\'s Steel Hurtin All Star team since the team\'s inception in 2007. Snot also plays with All Star teams, Wolfpack and the PA All Stars. She has won multiple jammer MVPs and doubles as one of the best blockers on the track. She is a Bont Quadstar and also loves her skateshop sponsor, RollerDerbySupply.net. Snot loves creativity, efficiency and fun in roller derby and it shows! Locally, Snot holds hour long open coaching sessions - if you\'re in Pittsburgh, drop in for a Snot Session! Snot\'s partner, BA, is the former coach of Steel City, Snot\'s personal coach and currently plays for Pittsburgh\'s men\'s team, the Blue Streaks. They speak the same derby language in different ways, getting through to even more skaters when they coach together.\n',0,25,NULL),(21,'Abby Sciutokill is a level 1 Corepower Yoga certified instructor and a co-founder of Dark Horse Roller Derby in Sweetwater, Texas. Check out her page, the Derby Yogi on facebook at https://www.facebook.com/thederbyyogi',0,26,NULL),(22,'Vicki Handyside is a retired World Champion Pairs competitive artistic skater.. She\'s taught skating skills to all ages and skill levels for over 40 years, and was the team coach for the Special Olympics, taught college classes, coached Girl Scouts, Boy Scouts and many regional and national Champions. She\'s been coaching derby teams and at Rollercon since 2011. Vicki also works in the distribution & manufacturing side of the roller skate industry, and currently represents Roll One - RollerBones - the very best in the business.',0,27,NULL),(23,'Razorslut has been skating, managing and coaching roller derby for over ten years on both banked and flat tracks and is known far and wide as the Nicest Person in LA. She got her start with the LA Derby Dolls, and now skates and coaches for SFV Roller Derby. She\'s skated and managed championship bouts for both flat and banked track teams, and regularly guest-manages teams all over California.\n',0,28,NULL),(24,'Smash Tank (Karen) is an independent skater based out of Daytona Beach, Florida, and owner of Body and Swole, LLC. She has a passion for staying fit for derby, and finds balance with high-level training and various styles of yoga. Smash\'s stories involve overcoming challenges, and she hopes to share what she has learned, and to encourage everyone to be their very best!',0,29,NULL),(25,'When Lemony Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters. flatmatrollerderby.com',0,30,NULL),(26,'Bo Toxic is an eight year veteran and has travelled the US playing at the highest level of both banked and flat track derby. Bo began coaching 2008 and is well versed in transitioning from surface to surface utilizing different rule sets to her advantage. Bo is currently a coach, player and staff member with the San Diego Derby Dolls. She is an aggressive blocker and known for her strong communication as a pivot but believes the key to success on any surface is team work.\n',0,31,NULL),(27,'8mean owns and coaches for Camp Pivotstar.  She is a proud coach of Team Canada Jr.  She has been skating for Terminal City Rollergirls since 2006 and is a two-time Team Canada player (11/14)    \n                                                                                                                                                ',0,32,NULL),(28,'Betty Ford Galaxy started as a founding member of the Rat City Rollergirls Throttle Rockets in 2004. She has also skated for Camaro Harem of Jet City Rollergirls (1 season), TTRB Banked partial season and now for the Rainier Roller Girls of Seattle. In 2005 Betty started the Seattle Derby Brats (non profit). She coached juniors full time until she retired from Seattle Derby Brats in 2014. She was a founder of the JRDA. Betty has coached many boot camps. She specializes in custom boot camps where she works with league coaches to get them to the next level. Betty is sober and an advocate for other sober derby friends. If you need someone to talk to about your own sobriety, feel free to reach out on Facebook. She is a great listener.',0,33,NULL),(29,'Merry Khaos is a member of Tampa Roller Derby, writer of the Khaos Theory Blog, \"\"Below the 45th\"\" for Jammerline Magazine, and a contributor to Blood & Thunder. She has been skating and coaching for six seasons, power-lifting for a year, and is a recognized member of the MRDA Dazzle. She is a health coach with Derbalife, coach with DNA Coaching, part of Team Demon United, and a Roller Derby Elite skater. Overall: she eats, sleeps, breathes, dreams, and obsesses over roller derby [and how to make us all better at it].http://www.khaostheoryblog.com',0,34,NULL),(30,'Lacey \"\"Carmen Getsome\"\" Ramon is both a Team Antiks skater and Team USA skater that has been on skates for 9 years.  She was a primary jammer for 7 years and in 2013 started blocking.  She is an exceptional pivot, performing devastating contact and containment on the opponent while reading the minds of her jammers, creating amazing offensive opportunities as well as executing sneaky hat passes. Getsome is the proud owner of Getsome Athletics, an international roller derby training company.\n',0,35,NULL),(31,'Laci Knight began playing, coaching and captaining roller derby for the LA Derby Dolls. She\'s a trainer for March Radness, Camp Scarlet and Getsome Athletics Camps. She is the current captain of Angel City Derby Girls\' Hollywood Scarlets and Head of On and Off Skates Training.',0,36,NULL),(32,'10 years ago Lulu was in hospital in South Africa with a broken neck and a shattered pelvis.  Last year she won League MVP, became Captain of the All Star team and started her derby clothing line Pivotstar.  Her motto in life and derby is, \"It\'s not how hard you can hit.  It\'s about how hard you can BE hit and keep moving forward.\" A self confessed \"jammer junkie,\" her goal is to help every skater, regardless of skill or position, to have fun and be successful while wearing the star.  She loves visualizations, playing smarter not harder and crumpets.',0,37,NULL),(33,'Quadzilla\'s self-written bio just said something dumb like, \"I\'m black and I skate,\" so here are just a few of the legends about him. Quadzilla LK started skating in diapers and joined his first derby team roughly sometime before puberty (which was way earlier than most of you people think), in the dark ages when the sport was played on inline skates by people with enormous hair and you were probably still teething.  He was a featured skater in a bunch of TV commercials, loves to jump rows of skaters laying on the ground, can skate with his skate on his ass better than most of you can skate with \'em on your feet, and has a new pair of flashy shoes every single time you lay eyes on him.  He guest coaches all over and has been seen rocking both flat and banked tracks on several continents.  He plays mens derby for the Puget Sound Outcasts, and developed Antik Skates, Heartless and B\'Zerk Wheels and Gumball Stops. We heard he was once a pro snowboarder.  He doesn\'t have anything at all to do with Derby News Network and has never been a ref, though he\'s not above wearing a dress if the situation calls for it.  He likes the kind of sushi that has fried things and cream cheese in it.  We don\'t think he\'s a super hero, but he does actually have a sidekick named Boy (something). For real. Little known fact: the \"LK\" stands for \"likes kumquats.\"\n',0,38,NULL),(34,'The Smacktivist #365 skates with the Ohio Roller Girls and serves the league as a trainer and go-to jammer. They have a strong background in Tier I, AAA Ice Hockey, and have acquired numerous MVP awards throughout their derby career, including 2012 North Central Regional Jammer, their rookie season. They also own and operate Next Level Skate Shop and Training, out of Columbus, OH, where they also skate ramps, lift heavy things, and hold down a positive mental attitude.',0,39,NULL),(35,'Mercy Shammah believes her coaching job is to challenge skaters, pushing them beyond their self-imposed limitations to help them play at their highest level of intensity and skill. Her dynamic coaching style echoes the ever changing sport or roller derby. Mercy has an adaptive range of coaching proficiencies. She provides limitless tips and feedback to skaters of all skill levels. Her skating history includes captaining the Wheels of Justice in 2014, she lead her team to a gold medal for International Playoffs and a silver medal for International Championships. Mercy is a member of Team USA and a proud member of Team Vagine.',0,40,NULL),(36,'Mic Wicked has been skating for 45 years. She started her derby journey with Harbor City Roller Dames and has also skated with the North Star Roller Girls, Duluth Derby Divas and the Moose Lake Mafia. She created and now coaches the only junior derby league in northern Minnesota, Twin Ports Junior Derby. She has also been a Rollercon medic since her 1st year in 2006.\n',0,41,NULL),(37,'Smarty lives and skates in Austin, Texas where she is part of the Texas Rollergirls, the Texecutioners and Team USA. She\'s been coaching for ages and enjoys sharing her knowledge of the sport. She\'s constantly looking for ways to improve and strengthen her own skill set and in turn, her classes tend to be based on the hot topics she has been focusing on in preparation for games. Smarty believes she has done her job right if you leave her class still thinking about the topics that were covered. She\'s not interested in skaters memorizing her concepts; she\'d prefer that they take the information they learn and play around with it until they have made it work for them. Smarty Pants has never missed a Rollercon and attributes the convention as a major factor in kicking off her coaching career. She believes that experiencing Rollercon is essential for every skater\'s true derby experience.\n',0,42,NULL),(38,'Chloroform Cupcake is an AFTDA certified traveling announcer, social media consultant, and owner of Curvy Derby as a certified Curvy Yoga instructor in the greater Las Vegas area. Specialities include: yoga for beginners, back pain and mobility circuits, and derby yoga (yoga for roller derby players and referees). She also is a supporter of the photo-bomb movement. Find her on Twitter: @derbyC8K3',0,43,NULL),(39,'Tara Hoedown has been skating with the Tilted Thunder Rail Birds for 5 years. The last two years have been her favorite as she skates on the All-Star team and is the captain of her home team, the Sugar Skulls. She\'s been a league coach for the last 2 years and really enjoys teaching derby. She currently coaches both flat and banked track derby in Seattle.\n',0,44,NULL),(40,'Isabelle Ringer has been a member of the San Diego Derby Dolls since January 2006 and played and coached on both flat and banked tracks worldwide for the 6 competitive seasons. Having spent many games, pivoting, blocking and jamming, Ringer has a diverse background of experience and loves the sport of roller derby on any surface. Recently retired from competitive play, Ringer is the full time Owner and General Manager of the San Diego Derby Dolls and spends the majority of her time working to grow and promote the sport of banked track roller derby.\n',0,45,NULL),(41,'Sausarge Rolls #11 from the land down under has been on skates now for more than two decades. He started his career playing inline hockey and quickly progressed to ice hockey where he played at the highest level for 12 years, traveling the world playing one of the roughest sports around - until he found Roller Derby. Within 4 years Sarge has gone from coaching his local league in Tasmania (DSDL) to coaching all around Australia. He was recently selected for The Wizards of Aus Men\'s Roller derby team in 2014 and played at MRDWC where he was selected for the World Team. He is non-stop and wants to share his experiences, skills and unique training methods as a derby player and hockey player with the broader derby community. He strongly believes he can teach skaters how to train smarter, harder and more efficiently. There will always be someone with more talent than you, but there\'s no excuse for someone to train harder than you!',0,46,NULL),(42,'Since entering the sport in 2005, Jackie has maintained her reputation as a top triple threat through a decade of rule changes, athletic advancement and her own injuries. With that experience, comes a wealth of knowledge and foresight into how roller derby is played at its best. Her passion for personal growth and team development is valuable example for both veteran players and the newest skaters. Jackie is a proud member of Texas Rollergirls and Team USA. Jackie previously skated as an original member of Grand Raggidy Roller Derby (2005-2009) and a member of Windy City Rollers (2010-2014). ',0,47,NULL),(43,'Suzy Snakeyes is a recently retired roller derby athlete and Certified Personal Trainer and Certified Strength and Conditioning Specialist based out of Los Angeles, CA. Suzy owns Power Jam Fitness (www.powerjamfitness.com), which provides derby-inspired group training, personal training and online fitness training to anyone looking to bring out their inner athlete. Suzy spent eleven years skating with the LA Derby Dolls and was a founding member and original captain of the Tough Cookies, the team that was the inspiration for the Hurl Scouts team in \"\"Whip It\"\". In her years with the LA Derby Dolls, she served as the original head of the league\'s training team, Captain of the Aftershockers (B-level all-star team) during the team\'s undefeated run in 2009, Assistant Coach of the Ri-ettes (A-level all-star team) in 2013 and instructor with the Derby Por Vida roller derby fitness program. Suzy is currently coaching the Tough Cookies and is on her eighth year teaching Derby Por Vida classes -- proving that even after retirement, Suzy just can\'t quit roller derby.\n',0,48,NULL),(44,'Zen started skating at 3 and hasn\'t stopped.  She relies on skating as her main form of exercise, skating marathons and using her skates as her primary transportation (sold the car 9 months ago). Zen trained as a dancer until a dislocated hip sidelined the dream. She\'s the founder of Heart2Heart Family Fitness, a non-profit that promotes the funnest thing ever - ROLLER SKATING!',0,49,NULL),(45,'Stormy Trooper starting skating flat track in 2005 and banked track in 2011. She started as a skating ref in 2009 and retired as a skater in 2011 after injury. She is currently Head of Officiating for three time MRDA National Champions Your Mom Men\'s Derby and WFTDA Team United, and staff ref for JRDA National Champion Des Moines Derby Brats.  She has officiated MRDA, WFTDA, JRDA, OSDA, RDCL, MADE, and a level 2 Certified USARS ref.',0,50,NULL),(46,'Cosmic is entering her fifth year of derby adventures. She loves derby on and off the track and is a dedicated NSO when not skating. Her favourite thing about derby are the friendships and the excited squeals of reunited skaters at RollerCon. Cosmic likes shiny things, the Milky Way, cats, skating, cuddles, ginger ale, blocking, and avocados.',0,51,NULL),(47,'Daft Spunk is captain of the Windy City Rollers All Stars and a proud member of Team Illinois. She\'s an expert in Applied Plows, Theoretical Hip Flushness, and Quantum Butts. Spunk loves teaching strategy and breaking down skills to help teams and individuals find success. Roller derby is pretty much all she does.',0,52,NULL),(48,'Sassin\'s love for derby was born with the Maui Roller Girls six years ago, but she has been practicing yoga for over a decade. Having tried a variety of styles, she fell in love with the intelligent alignments and freedom of expression of Wisdom Flow Yoga. The practical application of yoga for derby worn bodies was her inspiration to become a certified instructor. She believes that self-maintenance is as important to performance as tuning one\'s gear. You can\'t buy a new body at Sin City Skates, so take care of the one you\'ve got.',0,53,NULL),(49,'Nugget has coached everything from fresh meat to competitive WFTDA teams on both banked and flat track. Though he\'s only played derby for four years, he\'s been a part of this amazing community since 2009. Nugget\'s coaching style is very dynamic and diverse with the ability to explain drills a dozen different ways. He loves providing real time feed back along the way, so wear a shirt with your name on it.',0,54,NULL),(50,'Stef has made a name for herself as one of the most versatile players in roller derby - since joining London Rollergirls in January 2007 she has become a terrifyingly accurate blocker, a swift jammer and an all-out force to be reckoned with on the track. Captain of Team England, Atom All Star and Dymanic Sport Academy Sponsor. Stef was the first European skater to named WFTDA skater of the month (Oct 2011) and also first to be voted MVP at the 2011 Eastern Regional Play Offs. Stefanie was also awarded MVP awards for both games when her team London Brawling faced up against world champions Team USA and second place team Canada. Voted 2nd in 2011 and took 3rd in 2012 in the \'DNN best of poll\' in the Double threat category',0,55,NULL),(51,'Demanda Riot - IS real fucking scary.  She cannot MAKE you be real fucking scary (that\'s up to you), but she will show you how to do some of the real fucking scary things that she does. You\'ve likely had nightmares about her before the big bout, where you wake up screaming but can\'t quite remember why.  B.A.D to the bone & bleeding gold since 2007, Demanda Riot also skates with a myriad of ad hock and scrimmage teams such as Chupacabras Peligroso (redepantsipated Team Awesome), Team Legit, The Vagine Regiem, The CoEd Cripplers, Team Cruz, The Rejects ... ',1,56,NULL),(52,'Freight Train started with Houston Roller Derby and skates now for the Texas Rollergirls. She\'s been jam skating for 22 years - and she\'s only 24. She\'s been playing derby for about 4 seasons and has spent them working up the derby ranks to be the best player she can.',0,57,NULL),(53,'Peter Pan is a player and coach for the 3-time MRDA Champs, Your Mom Men\'s Roller Derby and the 2014 Men\'s World Cup Champions, Team USA Men\'s Roller Derby. He is also a 19-time World Champion speed skater on both quad and inline skates and a member of the USA Roller Sports Hall of Fame. He currently represents the Roller Derby Elite skate and equipment line.\n',0,58,NULL),(54,'Vanessa \"\"V-Diva\"\" Sites skates for Philly Roller Derby, captains the Pennsylvania All-Stars, and plays for Team USA Roller Derby, Team Atom and Blood & Thunder. She\'s sponsored by Atom Wheels, 187 Killer pads, Queen of the Sin Bin, and co-owns Apex Skate Shop. She\'s also PRD\'s WFTDA Rep & Inter-league Liaison and a member of the WFTDA Training Committee.\n',0,59,NULL),(55,'Vicki Handyside is a retired World Champion Pairs competitive artistic skater.. She\'s taught skating skills to all ages and skill levels for over 40 years, and was the team coach for the Special Olympics, taught college classes, coached Girl Scouts, Boy Scouts and many regional and national Champions. She\'s been coaching derby teams and at Rollercon since 2011. Vicki also works in the distribution & manufacturing side of the roller skate industry, and currently represents Roll One - RollerBones - the very best in the business.',0,60,NULL),(56,'Iron Panda is a travel coach and conditioning trainer for the San Fernando Valley Roller Derby (WFTDA) and SFV Juniors (JRDA) leagues. He\'s also the Coach/Trainer for SFV\'s Topanga Maul Rats, which is neat. Aside from Roller Derby, Iron Panda is a mixed martial artist, fitness trainer, and full time joker. He also likes breakdancing, video games, and beer. http://vincentfalconmartinez.com/\n',0,61,NULL),(57,'Allie Gator has been skating with the Mad Rollin Dolls (Madison, WI) since 2007. She is a proud member of The Quad Squad(Activate!), The Dairyland Dolls(Moo, Bitch!), Team Unicorn(Magical Neigh!), captain of the Great Lakes All-Stars(Humidity!), is AFTDA certified (Announcers, yo!) and is a Vanilla Sponsored Skater (VNLA). Besides skating Allie enjoys meeting ridiculous animals, geekery, playing ukulele & singing, outdoor skating and adventures.',0,62,NULL),(58,'WRECKING BILL PLAYS FOR THE ST. LOUIS  GATEKEEPERS, TEAM SEXY, TEAM BERZERKER, AND TEAM MISSOURI. HE IS A VANILLA SKATES SPONSORED SKATER, AND A VETERAN ROLLERCON PARTICIPANT AND TEACHER. HE *LOVES* CAPSLOCK - AND WE LOVE BILL.\n',0,63,NULL);
