INSERT INTO `scheduler_training` VALUES (1,'Absorbing Maintaining Contact Blocking','Flat Track',1,0,'2016-02-20 04:13:05','1.5',1,1,'Techniques, body mechanics and instruction to improve your forward and backward blocking space and lateral movement. \n*please note: this class is 1.5 hours long*\n',NULL,NULL,1,1,NULL),(2,'Advanced Powerful Jamming','Flat Track',1,0,'2016-02-20 04:13:05','2',1,1,'Truly powerful jamming. Learn to play defense and offense while you\'re scoring. Make holes for yourself!\n',NULL,NULL,1,1,NULL),(3,'Backfield in Motion','Flat Track',1,0,'2016-02-20 04:13:05','2',1,1,'Backward skating skills for those who can maneuver backward but really want to skate backward with power.  Skaters will learn how to propel themselves using as little effort as possible, how to access their backward edges, how to execute cross-pulls (sometimes called backward crossovers) and how to look good while doing it!  Each skill will be broken down in a step by step format that is both easy to understand and easy to teach to others.\n',NULL,NULL,1,1,NULL),(4,'Backwards Baby Steps','Flat Track',1,0,'2016-02-20 04:13:05','2',1,1,'Learn how to skate backwards for real!  Class is geared toward those skaters who are struggling and who need to better understand actual technique.  Skaters will see improvement in balance, edging, rhythm, speed and style. \n\n',NULL,NULL,1,1,NULL),(5,'Be SMART Goal Setting','Seminar/Conference Room',1,0,'2016-02-20 04:13:06','1',1,1,'Setting goals is easy but achieving them isn\'t. Setting SMART goals - specific, measurable, achievable, realistic and timely - is the first step in making your goal a reality. Bring your goals with a pen and paper, using the SMART framework, we will work to make your goals into SMART goals.  \"\"Many people fail in life, not for lack of ability or brains or even courage, but simply because they have never organised their energies around a goal.\"\" -Elbert Hubbard\n\n*Be prepared to sit on the floor*\n',NULL,NULL,1,1,NULL),(6,'Better Brakes for Blocking Your Wall','Flat Track',1,0,'2016-02-20 04:13:06','2',1,1,'Aggressive partner and wall blocking, including leading your opposition into a hit instead of hitting away from your partner.\n',NULL,NULL,1,1,NULL),(7,'Blockers Turned Jammer','Flat Track',1,0,'2016-02-20 04:13:06','2',1,1,'Sometimes the coach calls on you to jam even though you never jam at practice.  Learn how to have confidence in your jamming and use your beast mode blocker skills to make you a top notch jammer.\n',NULL,NULL,1,1,NULL),(8,'Blocking Backwards','Flat Track',1,0,'2016-02-20 04:13:06','2',1,1,'Most roller derby players know how to face an oncoming jammer and put their toestops down, but if you want to block effectively in a face to face position, you have to be able to control the jammer and drive them to the lines. Learn how to catch, stop and drive while facing oncoming traffic. Must be comfortable transitioning and skating backwards. \n\nA note from a RollerCon Scheduler who took this session at Camp Awesome last year: I watched one of roller derby\'s very best blockers learn new things in this class.*HIGHLY RECOMMENDED*\n',NULL,NULL,1,1,NULL),(9,'Body Skate','Seminar/Conference Room',1,0,'2016-02-20 04:13:06','1',1,1,'A low-impact, 45-minute whole-body workout for all fitness skill levels, designed to boost core and derby functional strength to improve joint control and avoid injury!  Off-skates cardio incorporating resistance using derby equipment so bring ALL the gear!  Showcases a full-body workout using equipment at hand - no need for expensive equipment.  A workout for all leagues, all levels - any time, any place!    \n',NULL,NULL,1,1,NULL),(10,'Brains Over Brawn Jammer Smarts','Flat Track',1,0,'2016-02-20 04:13:06','2',1,1,'Derby has evolved into a game where brains are just as essential as brawn. In order to have the advantage and squeeze out those extra points, it is essential for jammers to make smart decisions while simultaneously exhausting their bodies physically. This class will go over various situations during a jam including how to adjust start strategy, decide when to call off a jam, when to consider a star pass, when to become a fifth blocker, how to work together with your blockers and much more. We will discuss the variables in the game that need to be evaluated such as skills of those on the track, who is in the box, time on the clock, and mid jam situations that arise. This class is great for blockers also so they can work with and instruct their jammers appropriately.\n',NULL,NULL,1,1,NULL),(11,'Breakin  Floor Control  Fancy Feet','Seminar/Conference Room',1,0,'2016-02-20 04:13:06','1',1,1,'Don\'t be the kid at the after party faking a sprain because you don\'t know how to dance! You own the track at the bout, now own the floor at the party. Learn a complete set of breakin\' steps from setup to floor work,  including circle etiquette, taunts, and styles straight from the Los Angeles Hip-Hop underground.\n',NULL,NULL,1,1,NULL),(12,'Bridging for Offensive Blocking','Flat Track',1,0,'2016-02-20 04:13:06','2',1,1,'LEARN THE BENEFITS OF BRIDGING AND DIFFERENT STRATEGIES FOR OFFENSIVE BLOCKING.\n',NULL,NULL,1,1,NULL),(13,'BT Training Angles Are Our Friends','Banked Track',1,0,'2016-02-20 04:13:06','2',1,1,'This on skates class will cover all angles of the banked track and utilizing your speed and the force of the track to your advantage when blocking and jamming. We will break down stride, footwork, skating the coping, skating the rail and recycling for maximum coverage of the track. \n',NULL,NULL,1,1,NULL),(14,'BT Training Banked Basics','Banked Track',1,0,'2016-02-20 04:13:06','2',1,1,'Never skated on a banked track before?  This class is for YOU!  This on-skates training session will cover the basics of getting to know the inclined surface. This course will touch on rules, stride and lateral mobility. Great for skaters of all levels though it will truly be a basic intro course geared at those who have never skated on a banked track. Don\'t be shy. This course is for you to come on out and try the banked track!\n',NULL,NULL,1,1,NULL),(15,'BT Training Banked Track 101','Banked Track',1,0,'2016-02-20 04:13:06','2',1,1,'Ever wanted to try Banked Track? Here\'s your chance! We will go over all the basics: starting, stopping, pack definition, hitting and rail spins! Banked track is more fun than you can imagine. \n',NULL,NULL,1,1,NULL),(16,'BT Training Defense to Offense','Banked Track',1,0,'2016-02-20 04:13:06','2',1,1,'We will work on the quick change from defense to offense and back again, including the cues, placement, communication and execution of the offense and how to snap back to defense one you are done. Bring a black, white and a whole lot of hustle!\n',NULL,NULL,1,1,NULL),(17,'BT Training Derby Ice Cream Cone','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Offense and Defense: you need both to play good derby! We\'ll start with the basics of each and learn how to combine them for success. You\'ll learn different techniques and how they all work together to make tasty derby. Bring black and white shirts and a delicious attitude!\n',NULL,NULL,1,1,NULL),(18,'BT Training Dont Give a Bird Shit When He Flies','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Its not showing off or grandstanding - birds were born to fly! This course will focus on not only being effective with fancy moves, but also having fun while doing them, and enjoying yourself while bouting. \n',NULL,NULL,1,1,NULL),(19,'BT Training First Time on the Banked Track ','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'First Time on the Banked Track (Beginner, Contact Safe, Bouting Skaters)\nCurious about how to skate the banked track but want some technical know-how before you jump on it?  Look now further than this baby-steppin\' class that will get you from rail grabber to free skater in no time.  This is your chance to get on the track in a pressure free environment and have one of the greatest skate experiences of your life!\n',NULL,NULL,1,1,NULL),(20,'BT Training Flat to Banked ','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Turn your advanced flat track skills into banked track dominance. You already know how to play roller derby. Learn tips and tricks from bitraxual skaters to help translate your flat track knowledge into banked track dominance. We\'ll talk about the importance of zone defense, give you RDCL split pack tips and demonstrate the crucial physics of the 5th blocker for defense on banked. We\'ll also show how the the track benefits jammers and how to use your speed and increased ability to make fast lateral cuts to fake blockers off the rail or jump the apex and blaze through the pack. Not for new players - you should already be very comfortable on your skates and it would be helpful if you\'ve already had a chance to open skate the banked track so you\'re over that first couple laps of \"\"woah!\"\"\n',NULL,NULL,1,1,NULL),(21,'BT Training Great Pivots Arent Born','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Great Pivots Aren\'t Born; They Just Practice a Lot\n\nHave you ever felt like some people are more predisposed to pivoting than others? Like they were just born with more of those \"God-given talents?\" Not true. They have just been practicing longer. Maybe not on the track, but in their life they practice those skills. Both on and off-skates, you too can practice those skills to become a great Pivot. In this on-skates class, we will look at ways to speak confidently, lead and act all at the same time. Participants will learn drills to groom these talents and become more confident pivots.\n',NULL,NULL,1,1,NULL),(22,'BT Training Highs  Lows of Banked Track','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Weird thing about the banked track...it\'s all angled and stuff! So may as well figure out how to navigate those angles. In this class, we\'ll work on the nuances of blocking high and low on the banked track. We\'ll cover such important topics as moving laterally on the bank, how not to fling yourself off the track when you block to the inside, how to make use of your \"\"fifth blocker\"\" (aka the rail) and how to escape when you\'ve been handled by said \"\"fifth blocker\"\". Good for beginner banked track skaters, but you should be at least a B-C level on the flat track. \n\n',NULL,NULL,1,1,NULL),(23,'BT Training Jump To It','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Jumping is fun and SO MUCH EASIER TO LEARN on a flexible, bouncy wooden surface! Learn how to jump the apex, jump over a downed player and hop your way over obstacles!\n',NULL,NULL,1,1,NULL),(24,'BT Training Obstructive Blocking','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Obstructive Blocking: Sticky Orbits & Increasing Your Surface Area \n\nThis on-skates class will focus on breaking down effective techniques for obstructive blocking into its simplest parts. Tips for using maximum surface area as well as constant contact will be reinforced with lots of deliberate practice and incremental growth. This class is great for those just starting out in contact roller derby but can also be invaluable to more intermediate and advanced skaters working on reducing penalties and becoming more effective in the pack.  These techniques can be applied to both flat and banked track roller derby.  \n',NULL,NULL,1,1,NULL),(25,'BT Training Power Hitting on the Bank','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Hitting is just more fun on the banked! In this class you will learn how to maximize your hits using the incline of the track. The falling is easier too, the wood track allows you to pop right back up. So it\'s fun whether you are the hitter or the hittee! \n',NULL,NULL,1,1,NULL),(26,'BT Training RaDiCaL Differences','Banked Track',1,0,'2016-02-20 04:13:07','2',1,1,'Trying out the banked track means dipping your toes into a new ruleset pool! This class will help you navigate the waters. You\'ll be surprised to find a good number of similarities between Roller Derby Coalition of Leagues (aka RDCL) rules and WFTDA rules. We\'ll help you work through the rest. We\'ll examine one minute jams, changing lead jammers, \"\"pivot alley\"\" (what now?), split pack (no such thing as no pack or destruction of pack!) and more! Bring a black and white shirt and a desire to expand your derby horizons.\n\n',NULL,NULL,1,1,NULL),(27,'BT Training Scrimmage Scenarios','Banked Track',1,0,'2016-02-20 04:13:08','2',1,1,'Learn basic banked strategies in the context of directed scrimmage. This class will allow you to get some scrimmage time in with deliberate goals and scenarios. We will reassess every few jams and break down lining up to your advantage, power jams and avoiding penalties.\n',NULL,NULL,1,1,NULL),(28,'BT Training The Art of the Inside Hit','Banked Track',1,0,'2016-02-20 04:13:08','2',1,1,'This on-skates class will focus on skating skills needed for effective inside blocking. Then skaters will apply those skills to destructive blocking techniques that will drop opponents on their butts or send them sailing into the infield. These techniques can be applied on both flat and banked tracks. \n',NULL,NULL,1,1,NULL),(29,'Buti Yoga','Seminar/Conference Room',1,0,'2016-02-20 04:13:08','1',1,1,'Buti yoga means transformation from the inside out. It is a blend of plyometrics, tribal dance, yoga and cardio that opens up the chakras and gets you shaking that booty. Developed by Bizzie Gold, Buti uses spiral technology to strengthen and improve the core - a HUGE component of roller derby! http://butiyoga.com/about/#\n',NULL,NULL,1,1,NULL),(30,'Carve the Wall','Flat Track',1,0,'2016-02-20 04:13:08','2',1,1,'Learn how to take advantage of the wall from the rear. For blockers, this is the baseline for rear offense and the incorporation of timing. For jammers, this is a tool to get through the wall. This session finishes off with effective offense from the front. Come to this session as a jammer/blocker pair, if possible. ',NULL,NULL,1,1,NULL),(31,'Communication is Key','Flat Track',1,0,'2016-02-20 04:13:09','2',1,1,'Mayja Look and Carmen Getsome will teach you how to develop communication skills that will take you from an average joe to a derby pro!  Learn drills that help with proper and precise communication techniques while on the track doing work.\n\n',NULL,NULL,1,1,NULL),(32,'Crazzzy Legs','Flat Track',1,0,'2016-02-20 04:13:09','1.5',1,1,'Edgework, balance, quick reaction time; these are tools that must be in a skater\'s tool belt. Crazzzy legs are what happens when you put these pieces together to move around the track, within your wall, around a wall. Crazzzy legs are an asset to a blocker, and an ace up the sleeve for a jammer. Get ready to give your legs a workout. Drills are adaptable for any level, so come one, come all.\n\n1.5 hour session\n',NULL,NULL,1,1,NULL),(33,'Creating Drills on the Track Coaches  Captains','Flat Track',1,0,'2016-02-20 04:13:09','2',1,1,'Use scrimmage to create drills. We will break a concept down to its origin and build it up to the final picture. This class is highly recommended for on-skates captains and coaches. Bring black & white shirts with your number on them for scrimmage.\n\n',NULL,NULL,1,1,NULL),(34,'Damage Control Yoga','Seminar/Conference Room',1,0,'2016-02-20 04:13:09','1',1,1,'Easy yoga flow to keep you charging through the best week of your life. Do yourself a favor and stay in for the long game with a short time out to rehab and recoup. \n\n',NULL,NULL,1,1,NULL),(35,'Defensive Jamming','Flat Track',1,0,'2016-02-20 04:13:09','2',1,1,'Play smarter - not harder - and learn how to make the most out of your time on the track as a jammer. Sometimes it\'s enough to plow through the pack and score points, but it\'s even better if you can stay patient and help your blockers control the other jammer - thus maximizing the amount of time and control that you have while jamming. Nothing is more frustrating than breaking the pack with the other jammer right behind you. In this class you\'ll be set up with the tools for learning when and how to switch from offense to defense as a jammer, and come out on the other side calm, cool, collected, and in control. \n\n',NULL,NULL,1,1,NULL),(36,'Dial a Drill','Flat Track',1,0,'2016-02-20 04:13:09','2',1,1,'Looking to spice up practice with some new drills?  Reading about drills isn\'t the same as doing them!  From warm up to agility and endurance. Skaters can request specific skills to work on and I\'ll provide the drills.  (We\'ll skate through them together.)  Off skate coaches are also encouraged to attend as Mack the Mouth will be there to explain what to be looking for from a trainer\'s perspective. \n\n',NULL,NULL,1,1,NULL),(37,'Dirtys Little Secrets Coaches','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Are you a new skater?  A bouting skater who struggles with essential skating skills?  A vet who missed \"\"that day in class\"\"? A coach who wants tips on how to teach skills? A skater who is interested in how skills are broken down?  This class is for you.  Striding, stopping, transitioning, backward skating, jumping and spinning the quick and Dirty way.  \n',NULL,NULL,1,1,NULL),(38,'Do You Even Brace Bro','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'With such powerful jammers in today\'s game, sometimes we need a little extra support in our defense.  Learn some ins and outs on how to become a better bracer in your wall.  We will work on partner and triangle bracing.  Our focus will include backwards agility and tracking, utilizing the angles of the track, when and how much support to give to your teammates in the wall and when and how to replace.  \n\n',NULL,NULL,1,1,NULL),(39,'Dont Give a Bird Shit When He Flies','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Its not showing off or grandstanding - birds were born to fly! This course will focus on not only being effective with fancy moves, but also having fun while doing them and enjoying yourself while bouting. \n\n\n',NULL,NULL,1,1,NULL),(40,'Dont Just Stand There Power Jam Offense','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'What\'s the goal of a power jam? If your goal is to score the maximum number of points you can get in a 30 second time period, watching a jammer struggle alone won\'t do it. This class will discuss strategic options and also break down specific techniques for achieving this goal. Coaches and trainers welcome.  \n\n',NULL,NULL,1,1,NULL),(41,'Double Threat the Pivot','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Learn concepts that Pivots must have to help their team on defense and offense. This includes when, how and why not to pass the star.\n\n',NULL,NULL,1,1,NULL),(42,'Dynamic Demoralizing Walls','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Build dynamic demoralizing walls. Most skaters have trouble plow stopping in a wall formation, but you can learn to use edges and footwork to slow IN your wall. Break down mental barriers and build the skills to develop the kind of dynamic wall that will destroy the jammers. \n\n',NULL,NULL,1,1,NULL),(43,'EDGES EDGES EDGES ','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'This is the most important skill a skater needs to create a good foundation for their skating career. If you want to be become faster, more agile and perform wrap around moves, improve crossovers forward and backwards, and just improve your balance and skating, this is the class for you. We\'ll work on variations to push even the most experienced skaters comfort zones in all directions. What to bring: Bring all skate gear, open mind, sense of humour. All levels & skaters welcome that want to improve or learn how to get the most from their edges. \n\n',NULL,NULL,1,1,NULL),(44,'Effective Face to Face Blocking ','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'\"Most roller derby players know how to face an oncoming jammer and put their toestops down, but if you want to block effectively in a face to face position, you have to be able to control the jammer and drive them to the lines. Learn how to catch, stop and drive while facing oncoming traffic. Must be comfortable transitioning and skating backwards. \n\nA note from a RollerCon Scheduler who took this session at Camp Awesome last year: I watched one of roller derby\'s very best blockers learn new things in this class.*HIGHLY RECOMMENDED*\n',NULL,NULL,1,1,NULL),(45,'Express Yourself ','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Explore your inner figure skater!  Learn the 5 components needed to form an artistic skating program and then add your own style and choreography to the music provided.  You can even perform a solo routine for the group if you feel inspired! You will have a blast jumping, spinning, doing footwork, posing and just generally being super amazing. \n',NULL,NULL,1,1,NULL),(46,'Fab Form','Seminar/Conference Room',1,0,'2016-02-20 04:13:10','1',1,1,'In this slow paced workout/theory combo, we take a careful approach to ensuring fabulous FORM in your cross training. We will demonstrate and have you practice correct form for strength, plyometric training, and yoga, and talk about the why of alignment and placement for a variety of common exercises. Avoid injuring yourself through improper training form, and ensure you\'re getting the most out of your strengthening and stretching efforts!  If you\'ve ever wondered \"am I doing it right?\"  - find out in this class. Skaters and coaches alike are welcome to watch or participate.\n',NULL,NULL,1,1,NULL),(47,'Fancy Feet','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'This class will teach you to be able to do anything on your skates. Stop, Spin, Jump, Mohawk we will do it all. Don\'t worry if you\'re new! I will break it down and make it simple. You will be hockey stopping in the first 10 min then move on to more advanced movements.\n',NULL,NULL,1,1,NULL),(48,'Fancy Footwork','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Learn edges, agility, footwork, toe-stops, backwards skating and pivoting. Learn how to be a more dynamic, agile skater and how to maximize the use of your wheels and toe-stops. Hockey skills make a great derby skater!\n\nSlinky Ice loves skating and roller derby. She is currently the coaching coordinator and has previously held both Captain and Vice-Captain positions for the Chiko Rollers of Bendigo, Victoria, Australia. Slinky is known for her footwork and toe stop skills which she learned from playing ice hockey and state and national levels. Not only does she dance around the opposition, she also has her own language known as \'Slingo\'!',NULL,NULL,1,1,NULL),(49,'Fearless Jamming ','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Fearless Jamming: how to start a successful jamming career and have fun doing it! Lulu\'s goal is to help each and every skater be successful and have fun while wearing the star. For skaters just starting to jam, skaters that don\'t believe they will ever be a jammer or for skaters that have a fear of putting on the dreaded helmet cover. Come and learn mental tricks and skating techniques to aid you in your jamming quest. It will be fun!\n\n10 years ago Lulu was in hospital in South Africa with a broken neck and a shattered pelvis.  Last year she won League MVP, became Captain of the All Star team and started her derby clothing line Pivotstar.  Her motto in life and derby is \"It\'s not how hard you can hit. It\'s about how hard you can BE hit and keep moving forward.\" A self confessed \"jammer junkie,\" her goal is to help every skater, regardless of skill or position, to have fun and be successful while wearing the star.  She loves visualizations, playing smarter not harder and crumpets.\n',NULL,NULL,1,1,NULL),(50,'Figure 8in Skatin ','Flat Track',1,0,'2016-02-20 04:13:10','1.5',1,1,'\"Enhance your already awesome agility skills or build them if they are non-existant. This class will include more weaving and figure eight drills then you can imagine. Learn a 2-cone drill that you can do in your kitchen as well as several more agility building skills you can bring back and share with your leagues. All skill levels will benefit from this fun class.\n\n',NULL,NULL,1,1,NULL),(51,'FML Boot Camp','Seminar/Conference Room',1,0,'2016-02-20 04:13:10','1',1,1,'Wake up in the morning and kick ass before you even get to the track. Warm up, stretch, and light the burn in your the derby muscles to start the day!! Fire it up to take on the REST of your day. Bring a towel, training sneakers, and a bottle of water. \n',NULL,NULL,1,1,NULL),(52,'Footwork for Jamming ','Flat Track',1,0,'2016-02-20 04:13:10','2',1,1,'Learn how to use a combination of wheels and toe-stoppers to fluidly move past your opponent\'s defensive formations\n',NULL,NULL,1,1,NULL),(53,'Footwork in a Phone Booth ','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Stopper free agility in less space! Tighten up your footwork and improve your effectiveness in the pack.\n\n',NULL,NULL,1,1,NULL),(54,'From Zebras to Lions Officials','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Just because you\'re a zebra doesn\'t mean you get to skip out on learning how to skate like a derby player. Quick feet, lighting stops, instant reactions; they are mandatory tools for officiating roller derby. Without them, you cannot maintain proper positioning throughout an entire game. Its hard to maintain focus on scanning and analyzing actions throughout the entire game unless skating is second nature. This class is designed to teach the derby ref with little skating experience how to become better on their wheels, and how to recognize the forces and motion of the sport of roller derby to improve their overall officiating. Please BRING A MOUTHGUARD.\n',NULL,NULL,1,1,NULL),(55,'Get OfftheFence About Offense','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'This session will go over the ins and outs of strong offense. You will learn the pros and cons and identify when it\'s smart to execute offensive moves. We will then breakdown advance fundamentals for front offense and rear offense. Please bring your notebook.\n',NULL,NULL,1,1,NULL),(56,'Heads Shoulders Knees Wheels and Toes','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Footwork is so much more important these days.  Develope fancy footwork using your head, shoulders, knees, w-heels and toes whilst tricking your opponent - dancing your way through the pack. No coordination required. You don\'t need to have dance skills as a prerequisite.Great for jammers who are wanting something additional for their \'tool box\'. \n',NULL,NULL,1,1,NULL),(57,'Hockey Stops Hard Turns  Rapid Direction Changes','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Stopping Fast with Hockey Stops. One of the most important skills players need to aggressively change direction, wash off speed or dodge a hit.  We refer to them as a hockey stops but in hockey it\'s just called stopping. Really, its a hard turn that leaves you facing your desired direction. If you want to learn hockey stops & hard turns, improve them or strengthen your weak side, this is for you. Hockey Stops explained and broken down step by step with drill progressions to allow every skater to push their own boundaries and master this tricky skill. What to bring: Bring all skate gear & slippery wheels, open mind, sense of humor. Slippery wheels a must.\n',NULL,NULL,1,1,NULL),(58,'Hockey Stops PLUS','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'So you think you can hockey stop, huh? In this class, we\'ll double-check the fundamentals of hockey stopping and then we\'ll cross-over right on into technical combo-skills drills. We\'ll talk about when it\'s the best time to use a hockey stop, the best ways to power out of the stops, and ways we can tweak our hockey stops to maximize efficiency. Backwards, forwards, laterally, one-footed, you name it - we\'ll be doing it. This is all about dialing in your hockey stops and getting more confident in using them. \n',NULL,NULL,1,1,NULL),(59,'Hold the Line','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Playing your defensive wall as one unit and recycling in order to continue to Hold The Line. Learn some of the inside secrets to what makes Your Mom Men\'s Roller Derby line play some of the most innovative in roller derby.\n',NULL,NULL,1,1,NULL),(60,'House of Pain','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Developing both endurance and agility for multiple skate levels. This class is both entertaining and painful as we mix speed skating skills, figure skating skills and derby skills for one giant skills class.\n',NULL,NULL,1,1,NULL),(61,'Jam On It','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'How to use your own personal skills to successfully get lead jam. Use your size, speed and agility to control the other jammer as well as navigating through the pack. Also learn to work with your offense to create easy, penalty free opportunities to get points.\n',NULL,NULL,1,1,NULL),(62,'Jam Skating Fun for Better Derby','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Jam skating/soul skating is a creative way to hone your Derby skills. We will focus on building fancy muscle memory for better movement on the track, while learning how to shake your hips and move your feet to the beat!\n',NULL,NULL,1,1,NULL),(63,'Jammer Toolbox','Flat Track',1,0,'2016-02-20 04:13:11','1.5',1,1,'Learn multiple ways to engage the wall. Become more ready for whatever you opponents my throw at you. Be able to get though all types of walls. Find ways to get creative in the pack. Know ways to out smart even the best blockers. \n.',NULL,NULL,1,1,NULL),(64,'Keep Your Ass on the Track','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Calling all Jammers!  Hate getting pushed out of bounds and having to skate back 30 feet to get back in? Don\'t let this happen to you! - Stay on the track with smarts and strength and impeccable footwork. Hone your awareness to get rid of cut track penalties and save yourself from being bridged back. Stay in the game, stay out of the box.\n\n',NULL,NULL,1,1,NULL),(65,'Lets Break It Down','Flat Track',1,0,'2016-02-20 04:13:11','2',1,1,'Improve your skating technique.  Learn how to make your skates work for you and not the other way around.  We will be covering basic strides to gain speed without loss of energy, cross pulls both forward and backward, mohawk turns (transitions), skating in the opposite direction and learn a few added skating tricks.  This class is designed to build your self confidence on your skates!\n',NULL,NULL,1,1,NULL),(66,'Living on the Edge','Flat Track',1,0,'2016-02-20 04:13:12','2',1,1,'Stop an opponent all the way to the line.  Learn to use your edges and control your blocks when skirting the track boundaries.  Bait and track your opposition to the line.  \n',NULL,NULL,1,1,NULL),(67,'Magnetic Hips','Flat Track',1,0,'2016-02-20 04:13:12','2',1,1,'Magnetic Hips: Wall building for beginners. Any blocker can line up on the track and form a wall with their teammates, but then what? Who does what? Jammers are getting sneakier and sneakier every day. If you give them 2 inches, they\'ll make it 6 inches. If you give them 6 inches, they\'re already gone and you\'ve give them lead or your points. It\'s time to use what yo momma gave ya! Your hips! If you think of your hips as magnets, you will stay connected to your teammates and in contact with the opposing jammer. This session will teach you the basics of the Magnetic Hips wall strategy as well as a few different wall strategy options. Bring positive attitudes and black & white shirts. This session is good for any scrimmage-safe skill level, but is directed towards beginners.\n',NULL,NULL,1,1,NULL),(68,'Meditation for People Who Think They Hate Meditating','Seminar/Conference Room',1,0,'2016-02-20 04:13:12','1',1,1,'Think sitting still to meditate sounds like torture? Luckily, there are a lot more ways to meditate than just sitting in a kind of uncomfortable position, and you\'ll learn 5-10 fun and different techniques in this class. Studies show that among other things, meditation improves focus and endurance and lowers stress and anxiety, which makes it an awesome tool for athletes as you prep for your next bout. **Bring a notebook and pen.**\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(69,'Mind the Gap','Flat Track',1,0,'2016-02-20 04:13:12','2',1,1,'Sometimes the smallest space can make the biggest difference. The best players in the sport acknowledge where jammers and blockers are NOT, as opposed to where they are. We\'ll work on defensive and offensive drills that practice exploiting the gaps of the opposition. More than just \"\"Go where they are not\"\", the class will practice different ways of seeing angles and opportunities on the track, and applying them to strategies. We\'ll also work on how, as an individual, to create space for your team\'s advantage.',NULL,NULL,1,1,NULL),(70,'Mini Plyos','Seminar/Conference Room',1,0,'2016-02-20 04:13:12','1',1,1,'PLYOMETRICS - they make you sprint faster, jump higher and just basically be more bad ass. I created this program for the advanced juniors a few years ago and found it transfers to adults perfectly. The program was looked at by Children\'s hospital in Seattle and other Physical Trainers who gave me a thumbs up. This routine is short and can be done a few times a week to give you an advantage over the competition. No equipment needed except GOOD TRAINER SHOES. No bare feet, no clogs. Jumping needs proper support. I will walk you through each exercise, then we will do the whole thing together. You will get a hand out with the exercises in order. Great to learn and bring back to your team. \n',NULL,NULL,1,1,NULL),(71,'Morphing Your Defense ','Flat Track',1,0,'2016-02-20 04:13:12','2',1,1,'Learn how to adapt your defense depending on the number of skaters you have on the track.Work up from a 2 wall defense, to a triangle to a diamond.  We will focus on track coverage, quick replacement, positional blocking and working as a single defensive unit.  \n',NULL,NULL,1,1,NULL),(72,'New Skater Survival Scrimmage Tips','Flat Track',1,0,'2016-02-20 04:13:13','2',1,1,'Or \"\"How to look like you know what you\'re doing when the vets are watching\"\". Going from \'contact-ready\' to \'scrimmage-eligible\' is often not only daunting but comes too quickly. And often times vets forget to tell you very important things to help you survive the world of \"\"real derby.\"\" This class will go over tips, tricks, and skills to help you adjust quicker to the fast-paced world of scrimmage night.\n',NULL,NULL,1,1,NULL),(73,'NotSoFresh Meat','Flat Track',1,0,'2016-02-20 04:13:13','2',1,1,'Not-So-Fresh Meat is a class designed for newer skaters who are trying to break out of the Fresh Meat stigma and figure out their place in the derby world. Learn some basic tips on how to be a better skater, be a better blocker for your body type and a become a better jammer as well as some pointers on how to keep yourself in the right physical shape for derby.  You\'ll also learn ways to keep yourself motivated and how to be an integral part of your roller derby team.  This class will teach you how to skate hard, play smart and have fun! There are three rules for this non-contact class: \n1.) Be respectful to all.\n2.) Try your best.\n3.) Don\'t use the C-word: CAN\'T\n\n',NULL,NULL,1,1,NULL),(74,'Offense  Defense','Flat Track',1,0,'2016-02-20 04:13:13','2',1,1,'Ever find yourself playing defense but you see your jammer stuck and working her buns off? Learn how and when you can do both. Learn to execute amazing offense all while ruining the opposing jammer\'s life!\n',NULL,NULL,1,1,NULL),(75,'Officials  Skaters Rolling Zebras','Flat Track',1,0,'2016-02-20 04:13:13','1.5',1,1,'Great way for beginning and intermediate skating refs to learn positioning, communication, and proper procedure during games. Will work on skills, technique and standard procedure.\n',NULL,NULL,1,1,NULL),(76,'Officials Skating Skills OPR','Flat Track',1,0,'2016-02-20 04:13:13','2',1,1,'Starts, stops, transitions and sprinting - while calling penalties.\n',NULL,NULL,1,1,NULL),(77,'On Track Communication','Flat Track',1,0,'2016-02-20 04:13:14','1.5',1,1,'Learn how to communicate exactly what you need on the track to increase the strength of your defensive formations. \n\n',NULL,NULL,1,1,NULL),(78,'Other OnSkates Games','Flat Track',1,0,'2016-02-20 04:13:14','2',1,1,'GAMES! Because learning through play is something that super serious adults forget to do sometimes. New games and adaptations of classics from your childhood will act as secret drills and extra practice for all of your derby related skills! All games are ON SKATES, however many can be played off skates as well. Please bring shoes (as game props, thanks), black and white shirts, and your competitive spirit. And just like your childhood, only winners will receive prizes. \n',NULL,NULL,1,1,NULL),(79,'Pack Performance ','Flat Track',1,0,'2016-02-20 04:13:14','2',1,1,'This class is devoted to providing you in game feedback about you amd your packs perfomanve.  You and your pack will run through several scenarios set up in scrimmage style and after each jam you will get specific feedback about how you and you 4 pack buddies can improve.  Bring a pack of five to work with if you can ad well as a black and white shirt.   If you come alone you will be placed in a pack to work with the entire class.\n',NULL,NULL,1,1,NULL),(80,'Playing Down','Flat Track',1,0,'2016-02-20 04:13:14','2',1,1,'Practice and study defensive formations that make the best out of a bad situation.\n',NULL,NULL,1,1,NULL),(81,'PlyoWhat Demystifying','Seminar/Conference Room',1,0,'2016-02-20 04:13:15','1',1,1,'You know you need to cross-train, but what should you do, for how long, and when?? From injury prevention to nailing a huge apex jump, Booty Quake from Roller Derby Athletics will teach you to use your off-skate time to help you meet your goals and be unstoppable. Bring a hand towel, decent training shoes, water, and a notebook!\n',NULL,NULL,1,1,NULL),(82,'Positional Blocking  Blocking Without Looking ','Flat Track',1,0,'2016-02-20 04:13:15','2',1,1,'Positional Blocking & Blocking Without Looking \nPositional Blocking and blocking without looking: breaking down the key elements to this fundamental blocking skill. We\'ll go over ready position, footwork, balance all the skills needed to keep the jammer behind you. We\'ll also cover blocking without looking: Use your peripheral vision to land hits, drive jammers off, fool offense blockers and to keep the other team guessing.\n',NULL,NULL,1,1,NULL),(83,'Power Gams','Seminar/Conference Room',1,0,'2016-02-20 04:13:15','1',1,1,'Give yourself a strength and power boost behind your stride! These drills are designed to build strong derby legs with a combination of resistance training and plyometrics and a little upper body and core strength peppered in for good measure. Skate faster, juke quicker, jump higher and push harder! Come to the POWER GAMS off-skates class and gain the advantage on the track!\n',NULL,NULL,1,1,NULL),(84,'Power Skating','Seminar/Conference Room',1,0,'2016-02-20 04:13:15','1',1,1,'In traditional hockey power skating training, we train for balance, stability, and control, before we train for power and speed. This allows us to really hone in on the technical movements and muscle memory that are crucial for great skate form. Focusing on these areas also helps us strengthen our bodies in ways that help us prevent injury. In this off-skates athletic training course, we will delve into movements that are crucial for developing strength in our stability and control on the track. Bring tennis shoes, water, and focus. Excellent for all levels of skaters. \n',NULL,NULL,1,1,NULL),(85,'Power Skating Edge Work Fundamentals','Flat Track',1,0,'2016-02-20 04:13:15','2',1,1,'Adapted from traditional hockey power skating, this class is all about the technical aspects of edge work and weight transfer. In power skating, we focus on building a strong base of control and stability, which allows us to build up our power and speed in more effective and efficient ways. We\'ll be focusing on the mechanics of how our edges work and where we need to be transferring our weight for powerfully stable edge work. Plan to skate forwards and backwards and plan to fall down! Great for all level of skaters, but more focused on the intermediate folks looking to get their game to the next level. \n',NULL,NULL,1,1,NULL),(86,'Power Strength  Recruitment','Seminar/Conference Room',1,0,'2016-02-20 04:13:15','1',1,1,'Learn and be guided through Smarty\'s unique approach to engaging and waking up her muscles for blocking and jamming. \n',NULL,NULL,1,1,NULL),(87,'Push It Push It Real Good','Flat Track',1,0,'2016-02-20 04:13:15','2',1,1,'Power & Strength! In this class we will be learning how to prepare, move, and push ourselves through the mighty 4 man wall. The first half drills are designed to help to discover what stance and/or amount of strength you need to simply just get the wall moving. The second half will be more real world. We will be challenging ourselves - so expect sweat and for your heart to be pumping hard. \n',NULL,NULL,1,1,NULL),(88,'Ramming Jamming  Nailing','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Ramming, Jamming and Nailing will train you to be an aggressive jammer.  It focuses on the foot work to open gaps and the upper body contact force your way through. We will work on shoulder punching and slapping.  Using your body weight move blockers out of your way.\n',NULL,NULL,1,1,NULL),(89,'Reforming Walls','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Learn skills to reform walls to remove the jammer, not be disrupted by offense and maintain strong walls.\n',NULL,NULL,1,1,NULL),(90,'Restorative After Party Yoga','Seminar/Conference Room',1,0,'2016-02-20 04:13:16','1',1,1,'Restorative After Party is a simple restorative yoga class to help you wind down from the havoc that traveling, skating, working out, and after-parties that require lots of jumping around and drinking all the drinks! RollerCon takes a lot of energy mentally and physically for you to enjoy your stay. Why not wind down in a meditative savasana? Bring a pillow, blanket, hoodie, or any other items that will help you to relax and settle in a position for 20 minutes.\n',NULL,NULL,1,1,NULL),(91,'Rock You Like a Hurricane ','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Do you love skating at practice and getting the most out of your on-skates time? Do you believe in the saying practice makes perfect? Two important parts of becoming a great skater are spending time on skates and building muscle memory through repetition. Hurricane style drills accomplish both of these and is one of the most versatile types of drills to experiment with.  We will start out with simple blocking techniques and expand by adding focuses on footwork, speed, drive blocking and even backwards blocking.  Bring Black and White scrimmage shirts and be ready to skate!\n',NULL,NULL,1,1,NULL),(92,'Roller Disco','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Just what the name implies! Let\'s plug in an iPod and skate just for fun! Bring your tunes, if you want. \n',NULL,NULL,1,1,NULL),(93,'She Blinded Me With Science  the Physics of Blocking','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Defensive control for you and the wall you rode in on. We\'ll break down bio-mechanics and put a name on the fundamental tenants of blocking: absorbing impact, keeping hips flush and in front, and slowing your roll. It\'s not just a good idea. It\'s science. \n\n',NULL,NULL,1,1,NULL),(94,'Size Does Matter','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Hit smarter not harder!  Make effective hits with less energy while staying in play by using size differential.  Learn how to make every hit count and be the one that all jammers fear.  No bowling ball hits here.\n',NULL,NULL,1,1,NULL),(95,'Skills Before Drills ','Flat Track',1,0,'2016-02-20 04:13:16','2',1,1,'Work on a specific skills like transitions, agility, endurance and crossovers by focusing on the FIVE crucial elements that will speed your learning: \n1). Stance 2). Weight Transfer 3) Core Strength 4). Track Awareness 5). Confidence \nThis class is for anyone who would like to get past their current level of skill. This is geared towards the beginning to intermediate skater, but all levels are welcome.\n',NULL,NULL,1,1,NULL),(96,'Smart Derby Training','Flat Track',1,0,'2016-02-20 04:13:16','1',1,1,'This class is designed to help newer jammers and blockers realize when is the most appropriate time to call off a jam. Where are you? Where is the other jammer? Where is the pack? Who is in the box? Which team is controlling the pack? All of these questions are what a smart jammer is going to ask before thinking of calling it off. This is a double bonus for any new coaches, pivots, and mama hen communicators on the track.\n',NULL,NULL,1,1,NULL),(97,'Smart Derby Training Coaches','Flat Track',1,0,'2016-02-20 04:13:17','1',1,1,'This class is not just about the skills and strategies we teach,  but how we teach them.  Using time efficiently and effectively to pick allow each skater at your practice to get the most of your practice time.  Class will cover drills that not only build skill but work you hard as well. This class is great for skaters who get called on to coach practice or those who want to increase the effectiveness of their practices back home. \n',NULL,NULL,1,1,NULL),(98,'Smart Jammer Call Offs ','Flat Track',1,0,'2016-02-20 04:13:17','1',1,1,'This class is designed to help newer jammers and blockers realize when is the most appropriate time to call off a jam. Where are you? Where is the other jammer? Where is the pack? Who is in the box? Which team is controlling the pack? All of these questions are what a smart jammer is going to ask before thinking of calling it off. This is a double bonus for any new coaches, pivots, and mama hen communicators on the track.\n',NULL,NULL,1,1,NULL),(99,'So You Think You Can DANCE ','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'Non-contact, on skates workout to focus on core control using music.  Activates same muscles used in derby for jamming and blocking by using simple patterns of movement that are fun but exhausting. Focus is on obliques, calves, quads, shoulders.  Forces the use of \'thinking/memory\' while on skates and helps teach skaters not to overthink when they\'re skating - so they can focus on playing derby.\n',NULL,NULL,1,1,NULL),(100,'Speed Control in 1 on 1 Situations','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'Wearing an opposing skater like a second skin.  Not just how to get into her space and stay there by also how to make a dramatic speed change as well, with a focus on stopping skills as pertains specifically to this type of blocking.\n',NULL,NULL,1,1,NULL),(101,'Speed Juking  Nimbility ','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'High speed lateral movement, creativity and faking, Toe-stop Poppin and Line Hygiene! \n',NULL,NULL,1,1,NULL),(102,'Spin to Win','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'\"Use your body to block, make passes, avoid blocks, and get out of trapping, all by spinning into or away from opposing players.\n',NULL,NULL,1,1,NULL),(103,'Sponsored  Bruised Skate Noose Yoga','Seminar/Conference Room',1,0,'2016-02-20 04:13:17','1',1,1,'Love your Skate Noose and don\'t leave home without it? Want to know how to use it to help your body feel better after skating? Join Lemony Kickit of Flat Mat Roller Derby and Cakes of Curvy Derby with our guest, Vulgar Vixen from Bruised Skate Nooses! Learn some fun and easy options for incorporating your Skate Noose into your stretching routine to help help you release muscle tension while you\'re at RollerCon and beyond. Bonus: attendees will get 50% off a Bruised Skate Noose!\nhttp://www.bruisedsn.com/\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(104,'Sponsored Camp Elite Sneak Peek','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'\"Want to know what the most advanced skaters in the world are learning? Come by for a sneak peek at the training concepts that offered at Camp Elite.  Camp Elite is an advanced training camp held annually in Austin, Texas. It is only open to skaters on charter teams for WFTDA Div 1 & 2.  If your team is thinking about joining us for 2016, this is a great place to find out more about our camp and our coaches. Together we have 30 years of roller derby experience!  Open to all skaters for viewing, but intermediate - advanced only for on-skate participation.  \n',NULL,NULL,1,1,NULL),(105,'Sponsored Fun  Fitness The Games We Play','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'Games are an easy way to get skaters\' minds off their feet and improve their overall fitness and skating skills. They don\'t even realize they\'re getting better because they\'re having so much fun.  Ideal for coaches and other folks looking to improve skills and have some fun on roller skates.\n',NULL,NULL,1,1,NULL),(106,'Sponsored Roll Out Fitness Skating','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'\'Roll Out\' is a Fitness Skating class concept created and offered by Derby Lite.  High energy and non-stop, you\'ll get 60 minutes of on-skates dynamic warm-ups, HIIT sequences and full-body workout with no intentional falls, leaving you exhilarated and wondering how time went by so fast.  End this class with the most delicious stretch sequence you\'ve ever experienced, and bring what you learn back to your league. \n',NULL,NULL,1,1,NULL),(107,'Static Juking and Bracer Busting','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'Slow or stopped wall juking, pull-outs and pickup speed, and powerful initial impact.\n',NULL,NULL,1,1,NULL),(108,'Stop That Bitch','Flat Track',1,0,'2016-02-20 04:13:17','2',1,1,'Stopping Power is the foundation for all advance blocking. Learn how to control and slow an opponent in many ways and become a more versatile blocker for your team. \n',NULL,NULL,1,1,NULL),(109,'Stuck in the Middle with You','Flat Track',1,0,'2016-02-20 04:13:18','2',1,1,'INTERMEDIATE. It\'s that level where you\'re definitely past minimum skills, but you\'re definitely not Team USA. It\'s a very hard level to describe. You may be stellar at some things, and mediocre-tastic at others, and often you are either forgotten about in the void of \"\"intermediate\"\" or you become labeled as \"\"vet\"\" and now must teach the skaters lesser in skill than yourself. This class is a collection of individual, partner, and group skills (many different from last year!) that will help you progress into the realm of ADVANCED D1 ALL-STAR.\n',NULL,NULL,1,1,NULL),(110,'Sunday Practice for Smaller Leagues Coaches','Flat Track',1,0,'2016-02-20 04:13:18','2',1,1,'Learn how to develop practice for leagues and teams with fewer members, while incorporating new skaters into drills with experienced skaters. We\'ll cover basic practice structure, incorporating flexibility based on mixed skater abilities. Class provides coaching techniques and insight while focusing on drills with 5-8 skaters when scrimmage is not an option. Discussion involves paceline management, engagement drills, skater and time management, and teamwork in on and off skates drills. This class is designed to help coaches maximize practice with minimal turnout. \n',NULL,NULL,1,1,NULL),(111,'Sunrise Yoga','Seminar/Conference Room',1,0,'2016-02-20 04:13:18','1',1,1,'Started in 2014, the Sunrise Yoga sessions were a gathering of people from around the world sharing yoga before daily derby. The RollerCon yoga instructors joined us as well! All experience levels welcome, and requests are always great!\n',NULL,NULL,1,1,NULL),(112,'Swingers','Flat Track',1,0,'2016-02-20 04:13:18','2',1,1,'Learn to swing dance on your skates!  Edging, transitions, spins, toe stop work and more all with a partner.  All skill levels welcomed.  Bring your own partner or find a new one at class.  \n',NULL,NULL,1,1,NULL),(113,'Teaming Up to Work','Flat Track',1,0,'2016-02-20 04:13:18','2',1,1,'Derby is a game of intense teamwork. A successful player is one that her team can trust while being able to return the trust.  Identify the situation as an individual and react as a team. Nobody blocks alone here! We will break down the fundamentals of teamwork to help improve cohesion of movements between individuals.\n',NULL,NULL,1,1,NULL),(114,'The Breathing Room','Seminar/Conference Room',1,0,'2016-02-20 04:13:18','1',1,1,'With so many skaters attending RollerCon, the whole experience can be completely overwhelming even for veteran \'Con attendees - to say nothing of RC newbies. Come chill out with like-minded derby people - it\'s important to decompress and have time to share resources with others who may suffer from social anxiety. Exercises include guided meditative breathing, light yoga, and quiet talking. Bring a pillow!\n',NULL,NULL,1,1,NULL),(115,'Tight Defensive Formations','Flat Track',1,0,'2016-02-20 04:13:18','1.5',1,1,'Learn how to set up tight defensive formations that keep jammers with in a 10 feet radius on the track. \n',NULL,NULL,1,1,NULL),(116,'Tiny and Mighty ','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Are you a smaller in stature derby player? Are you tired of learning jamming and blocking techniques from coaches twice your size? All bodies are not created equal, and the great thing about roller derby is that each size and shape has its advantage. Dutch Crunch and Colture Shock are smaller than most and have learned how to use this to their advantage. Come learn their secrets to busting through walls and blocking more effectively than others twice your size. You may even get a bonus physics lesson!\n',NULL,NULL,1,1,NULL),(117,'Tracking for Defense  Offense','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Learn how to keep your opponent moving laterally on the track, rather than forward and you will learn the skill of using your body to keep track of the jammer. \n',NULL,NULL,1,1,NULL),(118,'Transitional Blocking Lateral into Positional','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Learn how to stop your opponent\'s forward movement, and then transition into holding them positionally. \n',NULL,NULL,1,1,NULL),(119,'Turnin Tricks','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Learn how to really transition with confidence and authority.  This skill will be taught in various forms and each form will be broken down in a  step by step fashion.  Focus will center upon both changing directions in a smooth fluid manner and also how to set-up for directing teammates and confronting/blocking opponents.  \n',NULL,NULL,1,1,NULL),(120,'Wall Configurations','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'There are a variety of different ways an effective wall can be built - which one your team chooses should be based on the strengths and weaknesses of your team.  Let\'s work through all the fun varieties together!  We\'ll consider solo bracing, double bracing, hip to hip, cross legged walls and more. \n',NULL,NULL,1,1,NULL),(121,'Whats With the Elbows','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Whats with all the elbows? Many rollergirls find they are getting major elbow penalties but don\'t know why. We are going to go over what poor blocking technique looks like and why that results in penalties. Next we\'ll develop our blocking form building our technique from the ground up. Going over key skills such as blocking with our weight properly centered yet delivering powerful drives, how to avoid over committing,  where our feet need to be, where we should make contact. All the basic you need to know to make you a powerful and reliable blocker.\n',NULL,NULL,1,1,NULL),(122,'Whats Your Edge','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Many skaters fail to get the most out of their skates, because they aren\'t using their edges effectively. That\'s right, those eight flat wheels have edges, and in this session we\'ll get up close and personal with them. Using your edges will massively improve your agility and lateral movement. You\'ll also gain serious power for hits, booty blocks, and quick stops. You\'ll feel more confident on your skates in general. Bring a skate tool, \'cause we might need to adjust your trucks. \n',NULL,NULL,1,1,NULL),(123,'World Class Plyometrics','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Learn the mechanics of high level plyometrics used by top speed skating athletes around the world.\n',NULL,NULL,1,1,NULL),(124,'Worst Case Scenarios','Flat Track',1,0,'2016-02-20 04:13:19','2',1,1,'Did you watch the Canada vs England bout at the 2014 World Cup? That game was won by a 44 point margin. 35 of those points were put up in a single jam.  We train for hour long games that can be won or lost in a 2 minute period. Come learn how we can train to avoid those 2 minutes of hell and keep our heads in the game when they do happen. \n',NULL,NULL,1,1,NULL),(125,'Yoga  Balancing Act','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Want to be the last one standing on the track? The right muscles and a better sense of proprioception can help you stay on your skates. Get ready to: learn how to use your feet, legs, and core; play with balancing on your feet (and maybe your hands!); and have fun experimenting with your sixth sense! Bring a towel.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(126,'Yoga  Core Strength','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Want better balance and stability on your skates--or maybe just the ability to hold plank longer than anyone else in your league? Six-pack abs don\'t equal a strong core, and this class will prove it with a mix of standing and seated yoga poses focused on finding the muscles that matter. Come ready to get your ass kicked--yes, by a yoga class!--and learn some fun and effective ways to build core strength and stability. Bring a towel.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(127,'Yoga  Its All In the Hips','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Yoga hip openers for derby. Yoga is an incredible cross training tool and this class focuses on the hips and flexibility to help your overall game play.\n\nAbby Sciutokill is a level 1 Corepower Yoga certified instructor and a co-founder of Dark Horse Roller Derby in Sweetwater, Texas. Check out her page, the Derby Yogi on facebook at https://www.facebook.com/thederbyyogi',NULL,NULL,1,1,NULL),(128,'Yoga  Learn to Fly','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Feet hurt from four days on the track? Free them from your skates and come play on your hands! If you\'ve ever been curious about trying some of the funkier yoga poses out there, this class will give you the basics to start flying into arm balances. You\'ll also get a sweet dose of core work, hip opening, twisting, and stretching--in other words, feel free to come do those pieces and hang out for the rest. Bring a towel.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(129,'Yoga  Minimum Skills','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Maybe you\'ve wanted to try yoga but have been intimidated by your local studio. Maybe you\'ve been doing videos online and want a yoga teacher there to check your form. Maybe you\'ve been practicing for a while but want a refresher on the basics. Whatever your reason for seeking an approachable yoga practice, this is the place to be! Consider this Yoga 101: you\'ll learn many of the typical poses that appear in yoga classes, accompanied by an all-inclusive and unpretentious vibe. Bring a towel.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(130,'Yoga  Off the Mat Onto the Track','Seminar/Conference Room',1,0,'2016-02-20 04:13:19','1',1,1,'Want to learn some ways to take yoga off the mat and onto the track? Join Cakes of Curvy Derby and Lemony Kickit of Flat Mat Roller Derby to get some ideas for how to use your yoga practice to up your game and make life more awesome. Feeling stressed? Nervous about your upcoming bout? Need to re-energize before practice? We\'ll give you four big tools to help bring yoga into your mental game.\n',NULL,NULL,1,1,NULL),(131,'Yoga  Shoulder Check','Seminar/Conference Room',1,0,'2016-02-20 04:13:20','1',1,1,'Raise your hand--hopefully without pain--if you or someone you know has dealt with a derby-related shoulder injury. The shoulder joints are some of the most injury-prone in the body, especially if they\'re taking hits. Learn how to strengthen the surrounding muscles to help prevent tears, dislocations, and separations. Definitely not for those with acute shoulder injuries, but if your shoulder injury isn\'t acute, you can do most of the moves with modifications, which we\'ll explore as needed.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(132,'Yoga  Slow  Steady','Seminar/Conference Room',1,0,'2016-02-20 04:13:20','1',1,1,'It\'s the last day of RollerCon, and your body needs a little downtime. Before you get on skates for the day, take some time to prep your muscles with slow, steady dynamic stretching. Come for the 9am wake up stretch, and stay for the 10am rest! Bring a towel.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(133,'Yoga  Stretch It OUT','Seminar/Conference Room',1,0,'2016-02-20 04:13:20','1',1,1,'Skating without stretching is like practicing without wearing proper equipment: it\'s only a matter of time until you get injured. Learn how to increase mobility and begin to correct imbalances in the most used and abused muscles and tissues in a skater\'s body. **Bring a towel and a belt or skate noose.**\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(134,'Yoga Naptime','Seminar/Conference Room',1,0,'2016-02-20 04:13:20','1',1,1,'Balance out the adrenaline and cortisol that have been surging through your body for the past four days by settling in for a guided meditation and relaxation practice called yoga nidra (yogic sleep). Bonus: if you didn\'t sleep Saturday night, 30 minutes of yoga nidra is said to be the equivalent of four hours of sleep! Bring some layers for warmth so that you can be comfortable.\n\nThink you don\'t like yoga? Lemony Kickit\'s classes might change your mind. When Kickit (Kat Selvocki) retired from Gotham Girls Roller Derby, yoga was the last thing she expected to find on the other side. That is, until she discovered a class called Yoga Fight Club, where she learned that she could do yoga AND hit people--in the same room. Sold! Since then, Kickit has completed 200+ hours of training and taught in her adventurous, mindful, unpretentious style around the globe. Based in Seattle, she specializes in teaching athletes and is the queen bee at Flat Mat Roller Derby: Yoga for Skaters.',NULL,NULL,1,1,NULL),(135,'You Can Do This Even if Your Rhythm Sucks','Flat Track',1,0,'2016-02-20 04:13:20','2',1,1,'\"Basic jam/rhythm skating footwork, including spins, kicks, glides, and line dance / spot skating.\n',NULL,NULL,1,1,NULL),(136,'Zumba with Fifi','Seminar/Conference Room',1,0,'2016-02-20 04:13:20','1',1,1,'Ditch the workout and join the party! If you\'re looking for a heart pumping workout but you\'re just not sure where to start... ZUMBA! Here\'s some of the benefits you can find in a zumba workout. Weight loss, body toning, make new friends, FUN, stress relief, IMPROVED COORDINATION, all ages welcome, mood booster, greater confidence, revs metabolism, motivation, and customizable. BONUS: improves footwork! Be sure to wear sneakers, bring water, and get ready to SWEAT! \n',NULL,NULL,1,1,NULL);
